package qa_project_javapackage_4;

public class RelationalOperator_4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a = 20;
		int b = 30;
		
		System.out.println(a>b);
		System.out.println(a<b);
		System.out.println(a>=b);
		System.out.println(a<=b);
		System.out.println(a==b);
	}

}
